const notes = [
  {
    id: 1,
    content: 'HTML is easy',
    important: true,
  },
  {
    id: 2,
    content: 'Browser can execute only Javascript',
    important: false,
  },
  {
    id: 3,
    content: 'GET and POST are the most important methods',
    important: true,
  }
]

const Note = ({ id, content }) => {
  <li>
    {content}
  </li>
}

const App = () => {

  if (!notes) {
    return 'not notes'
  }

  return (
    <div className="App">
      <h1>Class 4 bootcamp</h1>
      <ul>
        {notes.map(note =>
          <Note key={note.id} content={note.content} />
        )}
      </ul>
    </div>
  );
}

export default App;
